        /// </summary>
        /// <param name="nomination"></param>
        public void SendHRNominationNoticeMail(Nomination nomination)
        {
            try
            {

                DateTime todayDate = DateTime.Now;

                string maildate = todayDate.ToString("dd-MMM-yyyy");


                SmtpClient mailclient = new SmtpClient();

                mailclient.Host = "172.20.85.220";
                mailclient.Port = 25;
                mailclient.UseDefaultCredentials = false;

                mailclient.Credentials = new System.Net.NetworkCredential("servers", "p1ggyb@ck@sola");

                MailMessage mailmessage = new MailMessage();
                mailmessage.IsBodyHtml = true;
                mailmessage.To.Add("hadzhir@hollard.co.za");
                mailmessage.From = new MailAddress("appreciation@hollard.co.za");
                mailmessage.Subject = "#ShoutOut Nomination";

                string headerPicture = @"";
                byte[] headerbytepic = Convert.FromBase64String(headerPicture);
                Stream headerLogo = new MemoryStream(headerbytepic);

                LinkedResource headerResource = new LinkedResource(headerLogo, MediaTypeNames.Image.Jpeg);
                headerResource.ContentId = "shoutHead";
                headerResource.TransferEncoding = TransferEncoding.Base64;

                string footerPicture = @"";
                byte[] footerbytepic = Convert.FromBase64String(footerPicture);
                Stream footerLogo = new MemoryStream(footerbytepic);

                LinkedResource footerResource = new LinkedResource(footerLogo, MediaTypeNames.Image.Jpeg);
                footerResource.ContentId = "shoutFoot";
                footerResource.TransferEncoding = TransferEncoding.Base64;

                //mailmessage.Body = createBody(1, 5);
                AlternateView alternateview = AlternateView.CreateAlternateViewFromString(createHRNominationSuccessBody(nomination.NomineeId), null, MediaTypeNames.Text.Html);
                alternateview.LinkedResources.Add(headerResource);
                alternateview.LinkedResources.Add(footerResource);

                mailmessage.AlternateViews.Add(alternateview);
                mailclient.Send(mailmessage);

            }
            catch (Exception)
            {
                throw;
            }
        }

